import React, { Component } from "react";
import { Button, Grid } from "semantic-ui-react";

const City = props => {
  return (
    <Grid id="city">
      <Grid.Row columns={3}>
        <Grid.Column textAlign='right' fluid vertical>
          {props.currentCity ? (
            <h3>
              Question {props.cityIndex + 1} of 20: 
              </h3>) : null}
        </Grid.Column>
        <Grid.Column textAlign='center' fluid vertical>
        {props.currentCity ? (
              <h3>
              Where is{" "}
              {props.currentCity.name}?
            </h3>
          ) : null}
        </Grid.Column>
        <Grid.Column textAlign='left'>
          {props.nextButton ? (
            <Button onClick={props.nextQuest}>Next Q</Button>
          ) : null}
        </Grid.Column>
      </Grid.Row>
    </Grid>
  );
};

export default City;
